import React from 'react';
import PropTypes from 'prop-types';
import StudentTableHead from "./studentsTableHead/studentTableHead";
import StudentTableRow from "./studentsTableRow/StudentTableRow";
import ProductTableRow from "../../productsList/components/shared/productsTableRow/ProductTableRow";

const StudentsTableRow = ({student}) => {
    return (
        <StudentTableRow>
            <td >{student.name}</td>
            <td className="sku">{student.secondName}</td>
            <td className="quantity">{student.familyName}</td>
        </StudentTableRow>
    );
};

StudentsTableRow.propTypes = {

};

export default StudentsTableRow;
